using System.Collections;
using System.Collections.Generic;
using UnityEngine;

using static CWJ.JsonHelper;

public class Test_JsonToHashSet : MonoBehaviour
{
    [SerializeField] string json;

    [Space]
    public PipeGroupCollection_Hs pipeGroupDatas;

    [ContextMenu("InitPipeGroupData")]
    public void InitPipeGroupData()
    {
        pipeGroupDatas = JsonUtility.FromJson<PipeGroupCollection_Hs>(json);
    }

#if UNITY_EDITOR
    /// <summary>
    /// GroupDataCollection.HashSet 사용예시
    /// </summary>
    [ContextMenu("Editor_ForeachViaHashSet")]
    public void Editor_ForeachViaHashSet()
    {
        System.Text.StringBuilder stringBuilder = new System.Text.StringBuilder();
        foreach (var item in pipeGroupDatas.HashSet)
        {
            stringBuilder.AppendLine(item.group_id + "");
        }
        Debug.Log(stringBuilder.ToString());
    }
#endif
}

